INSERT INTO "PageContent" VALUES (20,0,'Interestelar/Sinopse do filme','As reservas naturais da Terra estão chegando ao fim e um grupo de astronautas recebe a missão de verificar possíveis planetas para receberem a população mundial, possibilitando a continuação da espécie. Cooper é chamado para liderar o grupo e aceita a missão sabendo que pode nunca mais ver os filhos. Ao lado de Brand, Jenkins e Doyle, ele seguirá em busca de um novo lar.','',''),(21,0,'A Origem/Sinopse do filme','Don Cobb é um ladrão que invade os sonhos das pessoas e rouba segredos do subconsciente. As habilidades especiais de Cobb fazem com que ele seja procurado pelo mundo da espionagem empresarial, mas lhe custa tudo que ama. Cobb recebe uma missão impossível: plantar uma ideia na mente de uma pessoa. Se for bem-sucedido, será o crime perfeito, mas um amigo prevê todos os passos de Cobb.','','../../../assets/images/slide/BMmarca.jpg'),(22,0,'Greenpeace','Greenpeace é uma organização não governamental ambiental com sede em Amesterdão, nos Países Baixos, e com escritórios espalhados em mais de 41 países.\n\nAtua internacionalmente em questões relacionadas à preservação do meio ambiente e desenvolvimento sustentável, com campanhas dedicadas às áreas de florestas (Amazônia no Brasil), clima, nuclear, oceanos, engenharia genética, substâncias tóxicas, transgênicos, agrotóxicos e energia renovável. A organização procura sensibilizar a opinião pública através de atos, publicidades e outros meios. Sua atuação é baseada nos pilares filosófico-morais da desobediência civil e tem, como princípio básico, a ação direta pacífica.','','http://captadores.org.br/wp-content/uploads/2016/05/Greenpeace.jpg'),(23,0,'Apple','Apple Inc. é uma empresa multinacional norte-americana que tem o objetivo de projetar e comercializar produtos eletrônicos de consumo, software de computador e computadores pessoais. Os produtos de hardware mais conhecidos da empresa incluem a linha de computadores Macintosh, iPod, iPhone, iPad, Apple TV e o Apple Watch. Os softwares incluem o sistema operacional macOS, o navegador de mídia iTunes, suíte de software multimídia e criatividade iLife, suíte de software de produtividade iWork, Aperture, um pacote de fotografia profissional, Final Cut Studio, uma suíte de vídeo profissional, produtos de software, Lógica Studio, um conjunto de ferramentas de produção musical, navegador Safari e o iOS, um sistema operacional móvel.','','https://upload.wikimedia.org/wikipedia/commons/thumb/8/84/Apple_Computer_Logo_rainbow.svg/500px-Apple_Computer_Logo_rainbow.svg.png'),(29,2,'Faroeste Caboclo','Não tinha medo o tal João de Santo Cristo\nEra o que todos diziam quando ele se perdeu\nDeixou pra trás todo o marasmo da fazenda\nSó pra sentir no seu sangue o ódio que Jesus lhe deu\n\nQuando criança só pensava em ser bandido\nAinda mais quando com um tiro de soldado o pai morreu\nEra o terror da cercania onde morava\nE na escola até o professor com ele aprendeu','Legião Urbana',''),(30,2,'Primeiro Andar','Não faz disso esse drama essa dor\nÉ que a sorte é preciso tirar pra ter\nPerigo é eu me esconder em você\nE quando eu vou voltar, quem vai saber\n\nSe alguém numa curva me convidar\nEu vou lá\nQue andar é reconhecer\nOlhar','Los Hermanos',NULL),(31,2,'O Bêbado e a Equilibrista','Caía a tarde feito um viaduto\nE um bêbado trajando luto\nMe lembrou Carlitos\nA lua tal qual a dona do bordel\nPedia a cada estrela fria\nUm brilho de aluguel\n\nE nuvens lá no mata-borrão do céu\nChupavam manchas torturadas\nQue sufoco!\nLouco!','Elis Regina',NULL),(32,2,'Roda Viva','Tem dias que a gente se sente\nComo quem partiu ou morreu\nA gente estancou de repente\nOu foi o mundo então que cresceu\nA gente quer ter voz ativa\nNo nosso destino mandar\nMas eis que chega a roda-viva\nE carrega o destino pra lá\n\nRoda mundo, roda-gigante\nRodamoinho, roda pião\nO tempo rodou num instante\nNas voltas do meu coração','Chico Buarque',NULL),(33,2,'Retrato','Eu não tinha este rosto de hoje,\nAssim calmo, assim triste, assim magro,\nNem estes olhos tão vazios,\nNem o lábio amargo.\n\nEu não tinha estas mãos sem força,\nTão paradas e frias e mortas;\nEu não tinha este coração\nQue nem se mostra.\n\nEu não dei por esta mudança,\nTão simples, tão certa, tão fácil:\n— Em que espelho ficou perdida\na minha face?','Cecília Meireles',NULL),(34,2,'Aninha e suas pedras','Não te deixes destruir…\nAjuntando novas pedras\ne construindo novos poemas.\nRecria tua vida, sempre, sempre.\nRemove pedras e planta roseiras e faz doces. Recomeça.','Cora Coralina',NULL),(35,1,'Interestelar','','','data:image/jpeg;base64,'),(36,1,'Alto da compadecida',NULL,NULL,'data:image/jpeg;base64,'),(37,1,'Ó paí ó','','','https://upload.wikimedia.org/wikipedia/pt/thumb/5/5c/%C3%93_Pa%C3%AD%2C_%C3%93.jpg/200px-%C3%93_Pa%C3%AD%2C_%C3%93.jpg'),(38,1,'Cine Holliúdy',NULL,NULL,'https://upload.wikimedia.org/wikipedia/pt/thumb/d/d4/Cine_Holli%C3%BAdy.jpg/200px-Cine_Holli%C3%BAdy.jpg'),(39,1,'Acarajé',NULL,NULL,'data:image/jpeg;base64,'),(40,3,NULL,'Nossa missão é apoiar todos os estudantes na aprendizagem; organizar atividades que estimulem a consciência cultural e social, trabalhar comos gestores, professores, estudantes e funcionários para realizar a missão da escola. Enfim, promover a leitura de forma que atenda tanto a comunidade escolar quanto a externa.',NULL,'fa fa-user'),(41,3,NULL,'Incentivo a leitura através do canto, recital, palestras, eventos, músicas, coreografias, peças teatrais, personificação do livro, livro eletrônico, coral e cineminha. É um programa que contempla vários projetos que tem como proposta fomentar ações em prol da leitura e do incentivo a criação do gosto pelo hábito de ler.',NULL,'fa fa-book'),(42,3,NULL,'Com os objetivos de: apoiar todos os estudantes na aprendizagem; organizar atividades que estimulem a consciência cultural e social; trabalhar com gestores, professores estudantes e funcionários para realizar a missão da escola. Enfim, promover a leitura de forma que atenda tanto a comunidade escolar, quanto a comunidade externa.',NULL,'fa fa-check-circle'),(43,3,NULL,'O programa é constituído dos seguintes projetos: Intervalos Culturais; Personificação do Livro; 15 minutos de Leitura, Sarau Biblioteca em Movimento; Grupo Biblioteca em Movimento; Produção de Livros; Biblioteca em Movimento Itinerante e Companhia de Teatro Biblioteca em Movimento.',NULL,'fa fa-users'),(45,0,'15 Min de leitura OLÁ','15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura15 Min de leitura','',''),(46,2,'Meu Cinema','Por estar bem, minha festa é te ver acordar\nVer de tudo um pouco sem cansar\nTento estar menos distante e veloz\nNessa de estar, não te deixar só\n\nSem deixar morrer a vibe\nSem descer da corda bamba eu fico um pouco mais\nLouco pra provar que eu amo você\n\nNessa de estar e não ficar só\nMeu coração já te entreguei','Phill Veras',NULL),(47,2,'O Piano','Valha-me, Deus\nSe é da carne o sentimento bom\nO pensamento que me soa o tom\nA poesia à toa\nA nostalgia boa\n\nE eu me entreguei\nFui da janela ao que me seduziu\nUm olho viu e o outro descobriu\nA poesia à toa\nA nostalgia boa','Phill Veras',NULL),(48,2,'Preciso Dizer Que Eu Te Amo','Quando a gente conversa\nContando casos, besteiras\nTanta coisa em comum\nDeixando escapar segredos\nE eu não sei em que hora dizer\nMe dá um medo, que medo\n\nÉ que eu preciso dizer que eu te amo\nTe ganhar ou perder sem engano\nEu preciso dizer que eu te amo tanto','Cazuza',NULL),(49,2,'O Tempo Não Pára','Disparo contra o sol\nSou forte, sou por acaso\nMinha metralhadora cheia de mágoas\nEu sou um cara\nCansado de correr\nNa direção contrária\nSem pódio de chegada ou beijo de namorada\nEu sou mais um cara\n\nMas se você achar\nQue eu tô derrotado\nSaiba que ainda estão rolando os dados\nPorque o tempo, o tempo não pára\n\nDias sim, dias não\nEu vou sobrevivendo sem um arranhão\nDa caridade de quem me detesta','Cazuza',NULL),(50,1,'Bahia',NULL,NULL,'data:image/png;base64,'),(52,0,'Guns N Roses','DescriçãoGuns N\" Roses é uma banda americana de hard rock formada em Los Angeles, Califórnia, em 1985. A banda já lançou seis álbuns de estúdio, três EPs e um álbum ao vivo. A banda já vendeu mais de 100 milhões de cópias em todo o mundo, sendo cerca de 43 milhões somente nos Estados Unidos',NULL,'data:image/jpeg;base64,'),(54,1,'Flores','','','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ9farvCARvIS4hNOoZVmNEe1yJOfiS1DA2NLFr0hXPVZmk1OeUrg'),(57,3,NULL,'Lorem Ipsum is simply dummy text of the printing and typesetting industry. \nLorem Ipsum has been the industry\"s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.',NULL,'fa fa-address-book');

